import React from 'react'

const BetaLessonTabs = ({lessons, selectLesson, selectedLesson}) =>
    <ul className="nav nav-tabs">
        {
           lessons.map((lesson, key) =>
            <li className={lesson===selectedLesson? "nav-item active":"nav-item"} 
                onClick={() => selectLesson(lesson)} key={key}>
                <a className="nav-link active">
                    {lesson.title}
                </a>
            </li>
            )
        }
        <li className="nav-item">
            <div className="input-group-append">
            <input
                // onChange={this.titleChanged}
                // defaultValue={this.state.lesson.title}
                className="form-control col-4"/>

                {/* <button onClick={this.createLesson} className="btn btn-primary">
                    Add Lesson
                </button> */}
            </div>
        </li>
    </ul>



export default BetaLessonTabs;
